function funcSearch() {
  log("funcSearch");

  const els = doc.gcn("btn_s ok btnCancel");
  log("els", els, els.length);

  const result = [];
  const dictCourse = {
    시스타18홀: "단일",
  };
  Array.from(els).forEach((el) => {
    const param = el.attr("data-resvdata").split("#");
    let [, , elDate, elTime] = param;
    elDate = elDate.split("-").join("");
    /*const elDate = param[2].str().split("-").join("");
    const elTime = param[3].str().split(":").join("");*/
    const elCourse = "시스타18홀";
    log("reserve search", dictCourse[elCourse], elDate, elTime);
    result.push({ date: elDate, time: elTime, course: dictCourse[elCourse] });
  });
  const param = {
    golf_club_id: "712d75fd-f137-11ec-a93e-0242ac11000a",
    device_id: "${deviceId}",
    result,
  };
  const addr = OUTER_ADDR_HEADER + "/api/reservation/newReserveSearch";
  post(addr, param, { "Content-Type": "application/json" }, (data) => {
    log(data);
    LOGOUT();
  });
}
